import React, { Component } from 'react';

class Home extends Component {



    state={

        images:[]


    }

    getdata=(props)=>{

        this.setState({images : props});

    }


    render() {
        return (
            <div>
                {console.log(images)}
            </div>
        );
    }
}

export default Home;
